import { Add, Remove } from '@mui/icons-material'
import React from 'react'
import styled from 'styled-components'
import Announcement from '../compenents/Announcement'
import Footer from '../compenents/Footer'
import Navbar from '../compenents/Navbar'
import NewsLetter from '../compenents/NewsLetter'

const Container = styled.div`

`

const Wrapper = styled.div`
    padding: 20px;
`

const Title = styled.h1`
    font-weight: 300;
    text-align: center;
`

const Top = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 20px;
`

const TopButton = styled.button`
    padding: 10px;
    font-weight: 600px;
    cursor: pointer;
    border: ${ props => props.type === "filled" && "none" };
    background-color: ${ props => 
        props.type === "filled" ? "black" : "transparent" };
    color: ${ props => props.type === "filled" && "white" };

`



const TopTexts = styled.div`

`

const TopText = styled.span`
    text-decoration: underline;
    cursor: pointer;
    margin: 0px 10px;
`

const Bottom = styled.div`
    display: flex;
    justify-content: space-between;
`

const Info = styled.div`
    flex: 3;
`

const Product = styled.div`
    display: flex;
    justify-content: space-between;
`

const ProductDetail = styled.div`
    flex: 2;
    display: flex;
`

const Image = styled.img`
 width: 200px;
`

const Details = styled.div`
    padding: 20px;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
`

const ProductName = styled.span`

`

const ProductId = styled.span`

`

const ProductColor = styled.div`
    width: 20px;
    height: 20px;
    border-radius: 50%;
    background-color:  ${ props => props.color } ;
`

const ProductSize = styled.span`

`

const PriceDetails = styled.span`
    flex: 1;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`

const Summary = styled.div`
    flex: 1;
`

const ProductAmountContainer = styled.div`
    display: flex;
    align-items: center;
    margin-bottom: 20px;
`

const ProductAmount = styled.div`
    font-size: 24px;
    margin: 5px;
`

const ProductPrice = styled.div`
    font-size: 30px;
    font-weight: 200;
`

const Hr = styled.hr`
    bac-color: #eee;
    border: none;
    height: 1px;
`


function Cart() {
  return (
    <Container>
        <Announcement />
        <Navbar />
        
            <Wrapper>

                <Title>YOUR BAG</Title>

                <Top>

                    <TopButton>CONTINUE SHOPPING</TopButton>
                    <TopTexts>
                        <TopText>Shopping Your Bag (2)</TopText>
                        <TopText>Your Whishlist (0)</TopText>
                    </TopTexts>
                    <TopButton type='filled'>CHECHOUT NOW</TopButton>

                </Top>

                <Bottom>

                    <Info>

                        <Product>

                            <ProductDetail>

                                <Image src="https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1614188818-TD1MTHU_SHOE_ANGLE_GLOBAL_MENS_TREE_DASHERS_THUNDER_b01b1013-cd8d-48e7-bed9-52db26515dc4.png?crop=1xw:1.00xh;center,top&resize=480%3A%2A"></Image>

                                <Details>

                                    <ProductName> <b>Product:</b> JESSIE THUNDER SHOES </ProductName>
                                    <ProductId> <b>ID:</b> 927340236402 </ProductId>
                                    <ProductColor color="black" />
                                    <ProductSize> <b>SIZE:</b> 36.5 </ProductSize>

                                </Details>

                            </ProductDetail>

                            <PriceDetails>

                                <ProductAmountContainer>

                                    <Add />
                                    <ProductAmount>2</ProductAmount>
                                    <Remove />

                                </ProductAmountContainer>

                                <ProductPrice>$ 31</ProductPrice>



                            </PriceDetails>
                            
                        </Product>

                        <Hr />

                        <Product>

                            <ProductDetail>

                                <Image src="https://hips.hearstapps.com/vader-prod.s3.amazonaws.com/1614188818-TD1MTHU_SHOE_ANGLE_GLOBAL_MENS_TREE_DASHERS_THUNDER_b01b1013-cd8d-48e7-bed9-52db26515dc4.png?crop=1xw:1.00xh;center,top&resize=480%3A%2A"></Image>

                                <Details>

                                    <ProductName> <b>Product:</b> JESSIE THUNDER SHOES </ProductName>
                                    <ProductId> <b>ID:</b> 927340236402 </ProductId>
                                    <ProductColor color="black" />
                                    <ProductSize> <b>SIZE:</b> 36.5 </ProductSize>

                                </Details>

                            </ProductDetail>

                            <PriceDetails>

                                <ProductAmountContainer>

                                    <Add />
                                    <ProductAmount>2</ProductAmount>
                                    <Remove />

                                </ProductAmountContainer>

                                <ProductPrice>$ 31</ProductPrice>



                            </PriceDetails>
                            
                        </Product>
                        
                        
                    </Info>

                    <Summary>summary</Summary>

                </Bottom>

            </Wrapper>

        <NewsLetter />
        <Footer />
    </Container>
  )
}

export default Cart
